import React from 'react';
import './Widget.css';

const Widget = React.memo(props => {
    const { data } = props;
    const { tag, tagText, word } = data;
    return (
        <div className="search-item">
            <div className="item-header display-flex">
                <div>
                    <div>{tag}</div>
                    <div>
                        {tagText && <span>{tagText}-</span>}
                        {word && <span>{word}</span>}
                    </div>
                    </div>
            </div>
        </div>
    );
});

export default Widget;
